import styles from './styles/sideMenu.module.css'

function SideMenu ({clicked}) {
    return (
        <div className={`${clicked ? "absolute -left-0": "hidden"} absolute top-0 h-full w-10/12 bg-white`}>
            <h1>Side Menu</h1>
        </div>
    )
}

export default SideMenu
